const Melyssa = () => {
    return (
        <>
        <div className="secondary-banner">	
			<img className="about-background" src="/images/Piercings/piercings-background.jpg" alt=""/>
		</div>

        <section className='Bio'>
            <img src="images/TattooArtists/Melyssa.jpg"/>
        </section>
        </>
    );
}

export default Melyssa;
